def generate_permutations(inputs):
    """Yield permutations of `inputs` using backtracking to keep memory usage low."""
    n = len(inputs)
    used = [False] * n
    current = [None] * n

    def backtrack(pos):
        if pos == n:
            # Yield a copy of the current permutation
            yield list(current)
            return
        for i in range(n):
            if not used[i]:
                used[i] = True
                current[pos] = inputs[i]
                yield from backtrack(pos + 1)
                used[i] = False

